import React from "react";
import { Carousel, Button, Card } from "react-bootstrap";
import "./Welcome.css";
import "bootstrap/dist/css/bootstrap.css";
import Love from "./WelcomeImg/love.jpg";
import Match from "./WelcomeImg/couple.gif";
import Welcomeimg from "./WelcomeImg/Welcome.jpg";
const Welcome = () => {
  return (
          <Card className="text-center card__style">
            <Card.Body>
              <Card.Title>Create account or LogIn for Match !</Card.Title>
              <Button className="button__index" variant="success" size="lg">
                Sign In
              </Button>
              <Button variant="dark" size="lg">
                LogIn
              </Button>
            </Card.Body>
            <Card.Footer className="text-muted">Enjoy</Card.Footer>
          </Card>
  );
};

export default Welcome;
